import React from 'react';
import Users from './components/user/Users';
import './App.css';
import Navbar from './components/partial/Navbar';

function App() {
  return (
    <div className="App">
    <Navbar />
    <div class="container mt-2">
      <Users />
      </div>
    </div>
  );
}

export default App;
